import logo from './logo.svg';
import './App.css';
import LinkEditorCard from './Components/LinkEditorCard/LinkEditorCard'
import LinkPreviewCard from './Components/LinkPreviewCard/LinkPreviewCard'

function App() {
  return (
    <div className="App">
      <LinkEditorCard className="link-editor-card"/>
      <LinkPreviewCard className="link-preview-card"/>
    </div>
  );
}

export default App;
